import { useEffect, useState } from 'react'
import '../UserColors/UserColors-style.scss'
export default function UserColors() {

	const [userColors, setLocalColors] = useState({})
	console.log(userColors)
	useEffect(() => {
		const userColors = localStorage.getItem('colors')
		if (userColors) {
			setLocalColors(userColors)
		}
	},[userColors])

	return (
		<div className='userColors-main'>
			<h2>User Colors</h2>
		</div>
	)
}
